&quot;Lifelong friends Alan and Joey are fighting side by side in Afghanistan, until Alan is lost in a surprise attack. Now Joey must comfort Alan's grieving widow Samantha and help her find the strength to go on. Lost in sorrow, Joey confesses that he has always been secretly in love with the gorgeous blonde and makes passionate love to her, vowing to take his best friend's place. But is Alan really a casualty of war, or has an awful mistake been made?&quot;

